import React from 'react';
import Container from 'react-bootstrap/Container';
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';
import frame3 from '../assets/frame3.png';

function ECommerceSection() {
    // Array of card content
    const cards = [
        {
            title: "Card Title 1",
            text: "Some quick example text to build on the card title and make up the bulk of the card's content.",
            buttonText: "Go somewhere 1"
        },
        {
            title: "Card Title 2",
            text: "Some quick example text to build on the card title and make up the bulk of the card's content.",
            buttonText: "Go somewhere 2"
        },
        {
            title: "Card Title 3",
            text: "Some quick example text to build on the card title and make up the bulk of the card's content.",
            buttonText: "Go somewhere 3"
        }
    ];

    return (
        <Container>
            <div className='row'>
                {/* Map over the cards array */}
                {cards.map((card, index) => (
                    <Card key={index} className='col-12 col-md-4 px-0 mx-3'>
                        <Card.Img variant="top" src={frame3} />
                        <Card.Body>
                            <Card.Title>{card.title}</Card.Title>
                            <Card.Text>
                                {card.text}
                            </Card.Text>
                            <Button variant="primary">{card.buttonText}</Button>
                        </Card.Body>
                    </Card>
                ))}
            </div>
        </Container>
    );
}

export default ECommerceSection;
